import BackGround from './UI/BackGround';
import Card from './UI/Card';

function Categories() {
	return (
		<div>
			<BackGround />
			<Card className='content'>
				<h1>Wybierz kategorie</h1>
				<a href='./quiz.html'>
					<div class='button'>Historia</div>
				</a>
			</Card>
		</div>
	);
}

export default Categories;
